import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";

function useLoopTyping(text, delay = 50, wait = 1200) {
    const [out, setOut] = useState("");
    const [idx, setIdx] = useState(0);
    useEffect(() => {
        if (idx < text.length) {
            const timer = setTimeout(() => setIdx(i => i + 1), delay);
            setOut(text.slice(0, idx + 1));
            return () => clearTimeout(timer);
        } else {
            const loop = setTimeout(() => setIdx(0), wait);
            return () => clearTimeout(loop);
        }
    }, [idx, text, delay, wait]);
    return out;
}

const LinkedInIcon = ({ size = 34 }) => (
    <svg height={size} width={size} viewBox="0 0 32 32" fill="none">
        <rect width="32" height="32" rx="9"
            fill="#ffffffcc" // pastel/transparent
            stroke="#7B9ACC" strokeWidth="1.8" />
        <path d="M11 13h2v7h-2v-7zm1-2.2a1.21 1.21 0 1 1 0-2.42 1.21 1.21 0 0 1 0 2.42zM13 15h1.8v1h.02c.25-.47.85-.98 1.8-.98 1.93 0 2.28 1.36 2.28 3.12V20h-2v-2c0-.5 0-1.15-.7-1.15-.7 0-.8.55-.8 1.12V20h-2v-5z" fill="#7B9ACC" />
    </svg>
);

const GithubIcon = ({ size = 34 }) => (
    <svg height={size} width={size} viewBox="0 0 32 32" fill="none">
        <rect width="32" height="32" rx="9"
            fill="#ffffffcc"
            stroke="#232751" strokeWidth="1.8" />
        <path d="M16 6C10.47 6 6 10.47 6 16c0 4.43 2.87 8.18 6.84 9.52.5.09.66-.22.66-.48v-1.7c-2.78.6-3.37-1.34-3.37-1.34-.45-1.14-1.1-1.44-1.1-1.44-.9-.61.07-.6.07-.6 1 .07 1.54 1.02 1.54 1.02.89 1.53 2.34 1.09 2.91.83.09-.64.35-1.09.64-1.34-2.22-.25-4.56-1.11-4.56-4.95 0-1.09.39-1.98 1.03-2.68-.11-.25-.45-1.25.1-2.6 0 0 .84-.27 2.75 1.02a9.57 9.57 0 0 1 2.5-.34c.85.004 1.71.115 2.5.334 1.9-1.3 2.74-1.02 2.74-1.02.55 1.35.21 2.35.1 2.6.64.7 1.03 1.59 1.03 2.68 0 3.84-2.34 4.7-4.57 4.95.36.31.68.93.68 1.88v2.79c.001.262.16.57.67.474A10.013 10.013 0 0 0 26 16c0-5.53-4.47-10-10-10z" fill="#232751" />
    </svg>
);

function FloatingSocialLinks() {
    return (
        <div style={{
            position: "fixed", right: 28, bottom: 28, zIndex: 99,
            display: "flex", flexDirection: "column", gap: 17
        }}>
            <motion.a
                href="https://www.linkedin.com/in/yafie-linkedin/"
                target="_blank"
                rel="noopener noreferrer"
                initial={{ opacity: 0, scale: 0.72, y: 72 }}
                animate={{ opacity: 1, scale: 1, y: 0 }}
                transition={{ type: "spring", stiffness: 370, damping: 22, delay: 0.1 }}
                whileHover={{
                    scale: 1.13,
                    rotate: [0, 12, -12, 0],
                    boxShadow: "0 5px 18px #7b9acc44"
                }}
                whileTap={{ scale: 0.99, opacity: .82, transition: { type: "spring" } }}
                style={{
                    borderRadius: 15,
                    overflow: "hidden",
                    boxShadow: "0 1.5px 11px #7b9acc18",
                    padding: 3.5,
                    background: "rgba(123,154,204,0.099)", // subtle blue
                    border: "1.7px solid #e1e9fa",
                    transition: "background .16s"
                }}
                aria-label="LinkedIn"
                transition={{
                    default: { type: "spring" },
                    rotate: { type: "tween", duration: 0.65 }
                }}
            >
                <LinkedInIcon size={38} />
            </motion.a>
            <motion.a
                href="https://github.com/yafie-github"
                target="_blank"
                rel="noopener noreferrer"
                initial={{ opacity: 0, scale: 0.72, y: 72 }}
                animate={{ opacity: 1, scale: 1, y: 0 }}
                transition={{ type: "spring", stiffness: 355, damping: 19, delay: 0.19 }}
                whileHover={{
                    scale: 1.13,
                    rotate: [0, -11, 11, 0],
                    boxShadow: "0 5px 18px #23275133"
                }}
                whileTap={{ scale: 0.99, opacity: .82, transition: { type: "spring" } }}
                transition={{
                    default: { type: "spring" },
                    rotate: { type: "tween", duration: 0.65 }
                }}
                style={{
                    borderRadius: 15,
                    overflow: "hidden",
                    boxShadow: "0 1.5px 11px #23275118",
                    padding: 3.5,
                    background: "rgba(123,138,200,0.07)",
                    border: "1.7px solid #e1e4ea",
                    transition: "background .16s"
                }}
                aria-label="GitHub"
            >
                <GithubIcon size={38} />
            </motion.a>
        </div>
    );
}

export default function HomePage() {
    const heroTxt = "Hi, I'm Yafie, an aspiring Software Engineer & Business Analyst.";
    const animated = useLoopTyping(heroTxt, 40, 1700);
    const navigate = useNavigate();
    return (
        <div style={{
            minHeight: "88vh", background: "#F9FAFC", display: "flex", flexDirection: "column",
            alignItems: "center", justifyContent: "center"
        }}>
            <div style={{
                fontWeight: 900,
                fontSize: 44,
                color: "#7B9ACC",
                letterSpacing: -2,
                minHeight: 65,
                textAlign: "center",
                width: "100%"
            }}>
                {animated}
            </div>
            <div style={{
                margin: "40px 0 18px",
                fontSize: 22,
                color: "#232751",
                opacity: .88,
                textAlign: "center"
            }}>
                Bachelor of Information Technology | Open for 2025&2026 Internship <br />
                <span style={{
                    fontSize: 17,
                    opacity: .67
                }}>Enterprise Software Development and Business Information System Management @UTS.</span>
            </div>
            <button
                onClick={() => navigate("/contact")}
                style={{
                    marginTop: 28, background: "#7B9ACC", color: "#fff", fontWeight: 800,
                    fontSize: 18, border: 0, borderRadius: 23, padding: "15px 46px", boxShadow: "0 2px 18px #d2ddec33", cursor: "pointer"
                }}>
                Contact Me
            </button>
            <FloatingSocialLinks />
        </div>
    );
}
